import useTheme from './themeProvider';
import ThemeToggle from './themeToggle';

const AppLayout = ({children}) => {
  const [ThemeMode, toggleTheme] = useTheme();
  return (
    <ThemeToggle toggle={toggleTheme} mode={ThemeMode}>
      DarkMode
    </ThemeToggle>
  )
}
export default AppLayout;
